import React from 'react';

const ToDoCard = ({ title, description, done }) => {
  return (
    <div>
      <h3>
        {title}
      </h3>
      <p>
        {description}
      </p>
      <span>
        done: {done}
        {console.log(done)}
      </span>
    </div>
  );
};

export default ToDoCard;
